import { useNavigate } from 'react-router-dom'
import { useRecoilValue, useRecoilState } from 'recoil'
import Button from '@mui/material/Button'

import { paymentState } from '../../recoil/atoms'
import CrudUnitTable from '../organisms/crudUnitTable'

import { Swiper, SwiperSlide } from 'swiper/react'
import SwiperCore, { Navigation } from 'swiper'
SwiperCore.use([Navigation])

import 'swiper/css'


function HomeEffectPage() {
    const [payments, setPayments] = useRecoilState(paymentState)
    const navigate = useNavigate()
    const buttonon = () => {
        navigate("/main")
    }


    <Swiper
        slidesPerView={1}
        navigation
        loop={true}
    >
        <SwiperSlide key={1}>
            <CrudUnitTable
                data={payments}
                columnNames={[ '金額', '名前', '項目', '支払い方法', '支払日', ]}
            />
        </SwiperSlide>
        <SwiperSlide key={2}>
            <CrudUnitTable
                data={payments}
                columnNames={[ '金額a', '名前', '項目', '支払い方法', '支払日', ]}
            />
        </SwiperSlide>
        <SwiperSlide key={3}>
            <CrudUnitTable
                data={payments}
                columnNames={[ '金額aa', '名前', '項目', '支払い方法', '支払日', ]}
            />
        </SwiperSlide>
    </Swiper>

    return(
        <>
            <h1>かっこいいエフェクト</h1>
            <Button onClick={buttonon}>始める</Button>
            <CrudUnitTable
                data={payments}
                columnNames={[ '金額', '名前', '項目', '支払い方法', '支払日', ]}
            />


        </>
    )
}

export default HomeEffectPage
